  false,\n\t\"url\": null,\n\t\"notes\": \"This report is prepared for the Colorado
  State Land Board on field studies conducted on state lands in the Browns Park Resource
  Management Area.  Inventories and analysis address the following items/issues: (1)
  Soil capabilities and limitations, (2) Ecological condition of state land, (3) Existing
  plant communities and species in relation to potential for the sites, (4) Need for
  range improvements, (5) Existing wildlife use and needs, (6) Monitoring locations
  for livestock grazing, migratory song birds and big game, (7) Existing pertinent
  data on adjoining BLM lands, (8) Suitability for livestock grazing/site potential,
  (9) Initial Stocking Rates, (10) Livestock grazing affect on existing uses, and,
  \ (11) Location and amount of invasive species.\",\n\t\"license_title\": \"License
